import Dashboard from '../Dashboard';
import AddMachine from '../Machine/AddMachine';
import MachineList from '../Machine/MachineList';
import DeleteMachine from '../Machine/DeleteMachine';
import EditMachine   from '../Machine/EditMachine';
import AddEmployee from '../Employee/AddEmployee';
import ManageEmployee from '../Employee/ManageEmployees';
import AddStock from '../Stock/AddStock';
import StockList from '../Stock/StockList';
let routes = [

  {
    path: "/",
    name: "Dashboard",
    component: Dashboard,
    exact: true,
  },

  {
    path: "/Stock/list",
    name: "Stock",
    component: StockList,
    exact: true,
  },

  {
    path: "/Stock/add",
    name: "Add Stock",
    component: AddStock,
    exact: true,
  },

  {
    path: "/Stock/delete/:id",
    name: "Delete Stock",
    component: DeleteStock,
    exact: true,
  },
  
  {
    path: "/Stock/edit/:id",
    name: "Edit Stock",
    component: EditStock,
    exact: true,
  },
  {
    path: "/Machine/list",
    name: "Machine",
    component: MachineList,
    exact: true,
  },

  {
    path: "/Machine/add",
    name: "Add Machine",
    component: AddMachine,
    exact: true,
  },

  {
    path: "/Machine/delete/:id",
    name: "Delete Machine",
    component: DeleteMachine,
    exact: true,
  },
  
  {
    path: "/Machine/edit/:id",
    name: "Edit Machine",
    component: EditMachine,
    exact: true,
  },


  
  {
    path: "/Employee/add",
    name: "Add Employee",
    component: AddEmployee,
    exact: true,
  },

  {
    path: "/Employee/list",
    name: "Manage Employee",
    component: ManageEmployee,
    exact: true,
  },
 
];

export default routes;
